import React from "react";
import { Button, Container, Row, Col } from "react-bootstrap";

function Accomodation() {
 return (
  <div
   style={{
    marginLeft: "100px",
    marginTop: "30px",
    width: "70%",
    height: "200px",
    minWidth: "350px",
   }}
  >
   <Container className="container_center" fluid>
    <Row>
     <Col sm="12">
      <h5>Mia Resort </h5>
     </Col>
    </Row>
    <Row>
     <Col sm="4">
      <div style={{ height: "100px", backgroundColor: "yellow" }}></div>
     </Col>
     <Col sm="4"></Col>
    </Row>

    <h3>2. Fusion Cam Ranh </h3>
    <h3>3. The Anam </h3>
    <h3>4. Alma Resort </h3>
    <h3>5. Intercontinental Nha Trang</h3>
   </Container>
  </div>
 );
}

export default Accomodation;
